private static EnumSet<Field> parseFieldsStr(String str, String delimiter) {
  if (str == null) {
    return null;
  }
  String[] strs = str.split(delimiter);
  EnumSet<Field> fieldList = EnumSet.noneOf(Field.class);
  for (String s : strs) {
    fieldList.add(Field.valueOf(s.trim().toUpperCase()));
  }
  return fieldList;
}
